        <Grid container className={classes.grid}>
            <CssBaseline />

            {/* <p>dashboard</p>
            <Button variant="contained" color="primary" onClick={handleLogout} >Logout</Button> */}

            <Grid item xs={2}>
                <Sidebar />
            </Grid>

            <Grid item xs={10}>
                <MainContent />
            </Grid>

        </Grid>
    )
}

export default Dashboard
